import React from 'react';
import './Dashboard.css'; // CSS 파일 임포트

function Dashboard() {
    // 임의의 데이터 (전력 사용량)
    const lineChartData = [1200, 1900, 3000, 5000, 2500, 3100];
    const barChartData = [4000, 3000, 2000, 5000, 3500];

    return (
        <div className="dashboard-layout">
            {/* 좌측 네비게이션 바 */}
            <div className="sidebar">
                <h3>대시보드</h3>
                <ul>
                    <li>종합 대시보드</li>
                    <li>개별 대시보드</li>
                </ul>
                <h3>검침 정보</h3>
                <ul>
                    <li>최대수요전력 관리</li>
                    <li>검침 데이터 조회</li>
                    <li>에너지 사용 요약</li>
                </ul>
            </div>

            {/* 메인 콘텐츠 */}
            <div className="main-container">
                <h2 className="title">차트 대시보드</h2>

                {/* 차트 섹션 */}
                <div className="chart-grid">
                    <div className="chart-card">
                        <h2>전력 사용량 추이 (선형 차트)</h2>
                        <div className="custom-line-chart">
                            {lineChartData.map((value, index) => (
                                <div
                                    key={index}
                                    className="line-bar"
                                    style={{
                                        height: `${value / 100}px`,
                                        left: `${index * 16}%`,
                                    }}
                                />
                            ))}
                        </div>
                    </div>

                    <div className="chart-card">
                        <h2>공정별 에너지 소비 (막대 차트)</h2>
                        <div className="custom-bar-chart">
                            {barChartData.map((value, index) => (
                                <div
                                    key={index}
                                    className="bar"
                                    style={{
                                        height: `${value / 100}px`,
                                    }}
                                >
                                        <span className="bar-value">{value}</span>
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Dashboard;
